import { useState } from "react";

function App() {
  const [artemsIQ, setArtemsIq] = useState(0);
  return (
    <div>
      <h2>Artems IQ</h2>
      <h1>{artemsIQ}</h1>
      <button onClick={() => setArtemsIq((iq) => (iq > 1 ? 0 : 1))}>
        Increase IQ
      </button>
      <button onClick={() => setArtemsIq((iq) => 0)}>Decrease IQ</button>
    </div>
  );
}

export default App;
